   "source": [
    "slices <- c(sum(tweet_sentences_data$meanSentiment < 0),sum(tweet_sentences_data$meanSentiment == 0),sum(tweet_sentences_data$meanSentiment > 0))\n",
    "labels <- c(\"Negative Tweets: \", \"Neutral Tweets: \", \"PositiveTweets: \")\n",
    "pct <- round(slices/sum(slices)*100)\n",
    "labels <- paste(labels, pct, \"%\", sep = \"\") #customize labeling#add\n",
    "#in appropriate colors for positive, neutral, negative\n",
    "pie(slices, labels = labels, col=c('red', 'yellow', 'green'),\n",
    "main=\"Tweet Sentiment Percentages\")"
   ]
